INSERT INTO `messages` VALUES (1,10,'<p>&nbsp;</p>\r\n<p>&nbsp;</p>','2011-10-01 10:33:46','2011-10-04 08:52:05',0),(2,5,'<p>Welkom</p>','2011-10-01 14:39:07','2011-10-03 19:37:18',0),(3,9,'<p>Voorlopig is ons aanbod nog beschikbaar op <a title=\"cursusdienst.infogroep.be\" href=\"http://cursusdienst.infogroep.be\" target=\"_blank\">cursusdienst.infogroep.be</a></p>\r\n<p>&nbsp;</p>','2011-10-03 19:24:03','2011-10-04 14:32:44',0),(4,3,'<p>Als je als student een PPK lidkaart hebt, dan krijg je per bestelling een euro korting. Als dit zo is, laat dan je PPK lidkaart zien in de OSD-shop. </p>','2011-10-03 19:26:14','2011-10-05 13:44:38',0),(5,5,'<p>De ESP Cursusdienst is open.</p>\r\n<p>Aarzel niet om regelmatig terug te komen en zien of we geen nieuwe samenvattingen, slides of readers uitgeven.</p>','2011-10-03 19:26:56','2011-10-03 19:26:56',0);
